import React, {Component} from 'react';
import { Grid, Row, Col, Panel, Media, Button } from 'react-bootstrap';


class Users extends Component {
  constructor(props) {
    super(props)
    this.state = {
      list:[]
    }
  } 
  render(){
    return (
      <Grid>
        <Row className="show-grid">
          <Col xs={12} md={8}>
            <Panel>
              <Panel.Body>
                <Media>
                  <Media.Left>
                    <img width={64} height={64} src={props.image} alt="thumbnail" ></img>
                  </Media.Left>
                  <Media.Body>
                    <Media.Heading>
                        {props.username}
                    </Media.Heading>
                    <p>
                      {props.bio}
                    </p>
                  </Media.Body>
                </Media>
                <Button>Delete</Button>
              </Panel.Body>
            </Panel>
          </Col>
        </Row>
      </Grid>
    )
  }
}


export default Users;
